import React from "react";
import Table from "react-bootstrap/Table";
import axios from "axios";

const VolunteerTable = () => {
  const [volunteerInfo, setVolunteerInfo] = React.useState();

  const volunteersInfo = () => {
    axios.get(`http://localhost:3001/volunteers`).then((res) => {
      const persons = res.data;
      setVolunteerInfo(persons);
    });
  };

  React.useEffect(() => {
    volunteersInfo();
  }, [volunteerInfo]);
  console.log(volunteerInfo);

  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>id</th>
          <th>name</th>
          <th>lang</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>1</td>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
        </tr>
        <tr>
          <td>2</td>
          <td>Jacob</td>
          <td>Thornton</td>
          <td>@fat</td>
        </tr>
      </tbody>
    </Table>
  );
};

export default VolunteerTable;
